CREATE DATABASE Social_Media_DB;


USE Social_Media_DB
CREATE TABLE Social_Media_Addiction (
Student_ID		INT	Primary Key,
Age				INT,
Gender			VARCHAR(50),
Academic_Level	VARCHAR(50),
Country			VARCHAR(50),
Avg_Daily_Usage_Hours	INT,
Most_Used_Platform	VARCHAR(60),
Affects_Academic_Performance	VARCHAR(50),
Sleep_Hours_Per_Night			INT,
Mental_Health_Score				INT,
Relationship_Status				VARCHAR(60),
Conflicts_Over_Social_Media		INT,
Addicted_Score					INT,
Addiction_Level					VARCHAR(50),
Sleep_Quality_Category			VARCHAR(50),
Avg_Daily_Hour_Usage_Category	VARCHAR(50)
);

SELECT * FROM Social_Media_Addiction




	(	1 ,	19 ,	'Female',	'Undergraduate',	'Bangladesh',	5.2 ,	'Instagram',	'Yes',	6.5 ,	6 ,	'In Relationship',	3 ,	8 ,	'High',	'Insufficient',	'Heavy User')	

---Identify platforms most associated with high addiction

SELECT Most_Used_Platform, 
       COUNT(*) AS High_Addiction_Count
FROM Social_Media_Addiction
WHERE Addiction_Level = 'High'
GROUP BY Most_Used_Platform
ORDER BY High_Addiction_Count DESC;

---Check correlation between sleep and addiction

SELECT Addiction_Level, 
       ROUND(AVG(Sleep_Hours_Per_Night), 2) AS Avg_Sleep_Hours
FROM Social_Media_Addiction
GROUP BY Addiction_Level
ORDER BY Avg_Sleep_Hours;

---Determine impact on academics by addiction level
SELECT Addiction_Level,
       COUNT(CASE WHEN Affects_Academic_Performance = 'Yes' THEN 1 END) AS Affected_Students,
       COUNT(*) AS Total_Students,
       ROUND(100 * COUNT(CASE WHEN Affects_Academic_Performance = 'Yes' THEN 1 END) / COUNT(*), 2) AS Percent_Affected
FROM Social_Media_Addiction
GROUP BY Addiction_Level
ORDER BY Percent_Affected DESC;

---Country-wise average mental health score and addiction level

SELECT Country,
       ROUND(AVG(Mental_Health_Score), 2) AS Avg_Mental_Health_Score,
       ROUND(AVG(Addicted_Score), 2) AS Avg_Addiction_Score
FROM Social_Media_Addiction
GROUP BY Country
ORDER BY Avg_Addiction_Score DESC;

---Find average daily usage by academic level
SELECT Academic_Level, 
       ROUND(AVG(Avg_Daily_Usage_Hours), 2) AS Avg_Hours
FROM Social_Media_Addiction
GROUP BY Academic_Level
ORDER BY Avg_Hours DESC;

